usUV = penumbraRatio * uLightSize;/// * uNearPleane / zReceiver; \r\n        return PCF_Filter(uv, zReceiver, filterRadiusUV, randomizer, shadowTextureIndex);\r\n    }\r\n#endif\r\n\r\nvec3 fresnelSchlickRoughness(float cosTheta, vec3 F0, vec3 F90, float roughness){\r\n    return F0 + (max(vec3(F90 - roughness), F0) - F0) * pow(1. - cosTheta, 5.0);\r\n}   \r\n\r\nvec3 F_Schlick_Frostbite (in vec3 f0 , in vec3 f90 , in float u ){\r\n\treturn f0 + ( f90 - f0 ) * pow(1. - u, 5.);\r\n}\r\n\r\nfloat DistributionGGX(vec3 N, vec3 H, float roughness){\r\n    float a      = roughness*roughness;\r\n    float a2     = a*a;\r\n    float NdotH  = max(dot(N, H), 0.0);\r\n    float NdotH2 = NdotH*NdotH;\r\n    float num   = a2;\r\n    float denom = (NdotH2 * (a2 - 1.0) + 1.0);\r\n    denom = PI * denom * denom;\r\n    return num / denom;\r\n}\r\n\r\nfloat GeometrySchlickGGX(float NdotV, float roughness){\r\n    float r = (roughness + 1.0);\r\n    float k = (r*r) / 8.0;\r\n    float num   = NdotV;\r\n    float denom = NdotV * (1.0 - k) + k;\r\n    return num / denom;\r\n}\r\n\r\nfloat GeometrySmith(float NdotV, float NdotL, float roughness) {\r\n    float ggx2  = GeometrySchlickGGX(NdotV, roughness);\r\n    float ggx1  = GeometrySchlickGGX(NdotL, roughness);\r\n    return ggx1 * ggx2;\r\n}\r\n\r\n\r\nuniform int useIBL;\r\n#ifdef USE_IBL\r\n    uniform sampler2D tSpecularEnv0;\r\n    uniform sampler2D tDiffuseEnv;\r\n    uniform sampler2D tSpecularEnv1;\r\n    uniform sampler2D tSpecularEnv2;\r\n    uniform sampler2D tSpecularEnv3;\r\n    uniform sampler2D tSpecularEnv4;\r\n    uniform float uIBLDiffuseMix;\r\n    uniform float uIBLSpecularMix;\r\n    const vec2 invAtan = vec2(0.1591, 0.3183);\r\n    vec2 SampleSphericalMap(vec3 v) {\r\n        vec2 uv = vec2(atan(v.z, v.x), asin(v.y));\r\n        uv *= invAtan;\r\n        uv += 0.5;\r\n        return vec2(uv.x, uv.y);\r\n    }\r\n#endif\r\n\r\nuniform int uDepthPass;\r\nuniform int uShadowMapPass;\r\nuniform sampler2D tDepth;\r\nu